import React from 'react';

function ProjectCard({ name, thumb }) {
  return (
    <div className="project-card">
      <h2>{ name }</h2>
      <img src={ thumb } alt={ name } className="project-image" />
      { console.log(thumb) }
    </div>
  );
}

export default ProjectCard;
